export class Appointment {
    id: number = 0;
    name: string = "";
    doctorName: string = "";
    age: string = "";
    symptoms: string = "";
    mobile: string = "";
    registerDate: Date = new Date();  // Initially, it stores the current date
    updatedDate: Date = new Date();  // Will be updated on modification
    appointmentNumber: string = "";
}
